import React from 'react';
import cv from '../../../images/CVDanielleAharon.pdf';


export default function About() {
  return (
    <section id="about" >
    <div >
      <div className="card">
        <div className="card-content">
          <div className="row">
            <div className="mycolum"></div>
          <h6 className="mt-bottom">
            <strong>Danielle Aharon</strong>
          </h6>
          </div>
    </div>
    </div>
    </div>

    </section>
  );
}
